```cpp /// \brief Parameters for calibration pose generation struct CalibrationPoseGeneratorParameters { std::string robotName; ///< name of the robot to move std::string manipName; ///< name of the manipulator grabbing the calibration board std::string calibrationLinkName; ///< name of link that contains the relevant calibration board geometry std::string calibrationObjectName = "_calibboard_"; ///< name of the object that contains the calibration board std::string calibrationGeometryName = "_calibboard_"; ///< name of calibration board (box) geometry inside calibration link std::string cameraCoverLinkNamePrefix = "_cameracover_"; ///< prefix name of the camera cover link on the robot mujin::SensorSelectionInfo primarySensorSelectionInfo; ///< name of the primary sensor to be calibrated (attached to _cameraRobot) std::vector<mujin::SensorSelectionInfo> secondarySensorSelectionInfos; ///< vector of names of secondary sensors to be calibrated (assumed to be nearby _primarySensor)
// For PoseGrid initialization. The space in which we discretize into voxels is determined by the camera internal properties. int numPoseGridStepsX = 7; ///< voxel discretization steps along the X-axis of the camera coordinate system int numPoseGridStepsY = 7; ///< voxel discretization steps along the Y-axis of the camera coordinate system int numPoseGridStepsZ = 7; ///< voxel discretization steps along the Z-axis of the camera coordinate system dReal minPoseGridDepth = 0.5; ///< distance in meters from camera center to top of pose grid dReal maxPoseGridDepth = 1.5; ///< distance in meters from camera center to bottom of pose grid dReal minPatternTiltAngle = 10 * (M_PI / 180); ///< minimum angle in radians between calibration pattern plane and camera image plane dReal maxPatternTiltAngle = 30 * (M_PI / 180); ///< maximum angle in radians between calibration pattern plane and camera image plane int maxSamplingIterationsPerPose = 100; ///< number of sampling attempts before giving up when generating a valid configuration at a pose grid voxel
// For occlusion checking dReal fDistanceBetweenPatternAndOcclusionBodyBase = 0.02; ///< offset in meters to add to the pyramid base so that it is not colliding with the calibration board/pattern dReal fOcclusionBodyScaleFactor = 1.0; ///< determines how large the base of visibility pyramid (for occlusion checking) should be when compared to the calibration board size
int maxEntriesInCollisionSummary = 3; ///< Number of colliding link pairs per collision type to include in collision summary report }; ```

```cpp
inline CalibrationPoseGenerator::CalibrationPoseGeneratorParameters GetCalibrationPoseGeneratorParameters(py::dict oparams) {
        CalibrationPoseGenerator::CalibrationPoseGeneratorParameters params;

        if( DICT_CONTAINS_KEY(oparams, "robotName") ) {
            params.robotName = extract<std::string>(oparams["robotName"]);
        }

        if( DICT_CONTAINS_KEY(oparams, "manipName") ) {
            params.manipName = extract<std::string>(oparams["manipName"]);
        }

        if( DICT_CONTAINS_KEY(oparams, "calibrationLinkName") ) {
            params.calibrationLinkName = extract<std::string>(oparams["calibrationLinkName"]);
        }

        std::string calibrationObjectName = "_calibboard_";
        if( DICT_CONTAINS_KEY(oparams, "calibrationObjectName") ) {
            calibrationObjectName = extract<std::string>(oparams["calibrationObjectName"]);
        }
        params.calibrationObjectName = calibrationObjectName;

        std::string calibrationGeometryName = "_calibboard_";
        if( DICT_CONTAINS_KEY(oparams, "calibrationGeometryName") ) {
            calibrationGeometryName = extract<std::string>(oparams["calibrationGeometryName"]);
        }
        params.calibrationGeometryName = calibrationGeometryName;

        std::string cameraCoverLinkNamePrefix = "_cameracover_";
        if( DICT_CONTAINS_KEY(oparams, "cameraCoverLinkNamePrefix") ) {
            cameraCoverLinkNamePrefix = extract<std::string>(oparams["cameraCoverLinkNamePrefix"]);
        }
        params.cameraCoverLinkNamePrefix = cameraCoverLinkNamePrefix;

        if( DICT_CONTAINS_KEY(oparams, "primarySensorSelectionInfo") ) {
            params.primarySensorSelectionInfo.sensorName = extract<std::string>(oparams["primarySensorSelectionInfo"]["sensorName"]);
            params.primarySensorSelectionInfo.sensorLinkName = extract<std::string>(oparams["primarySensorSelectionInfo"]["sensorLinkName"]);
        }

        if( DICT_CONTAINS_KEY(oparams, "secondarySensorNames") ) {
            params.secondarySensorSelectionInfos.resize(len(extract<py::object>(oparams["secondarySensorNames"])));
            for(size_t i = 0; i < params.secondarySensorSelectionInfos.size(); ++i) {
                mujin::SensorSelectionInfo& sensorSelectionInfo = params.secondarySensorSelectionInfos[i];
                sensorSelectionInfo.sensorName = extract<std::string>(oparams["secondarySensorNames"][i]["sensorName"]);
                sensorSelectionInfo.sensorLinkName = extract<std::string>(oparams["secondarySensorNames"][i]["sensorLinkName"]);
            }
        }

        int numPoseGridStepsX = 7;
        if( DICT_CONTAINS_KEY(oparams, "numPoseGridStepsX") ) {
            numPoseGridStepsX = extract<int>(oparams["numPoseGridStepsX"]);
        }
        params.numPoseGridStepsX = numPoseGridStepsX;

        int numPoseGridStepsY = 7;
        if( DICT_CONTAINS_KEY(oparams, "numPoseGridStepsY") ) {
            numPoseGridStepsY = extract<int>(oparams["numPoseGridStepsY"]);
        }
        params.numPoseGridStepsY = numPoseGridStepsY;

        int numPoseGridStepsZ = 7;
        if( DICT_CONTAINS_KEY(oparams, "numPoseGridStepsZ") ) {
            numPoseGridStepsZ = extract<int>(oparams["numPoseGridStepsZ"]);
        }
        params.numPoseGridStepsZ = numPoseGridStepsZ;

        dReal minPoseGridDepth = 0.5;
        if( DICT_CONTAINS_KEY(oparams, "minPoseGridDepth") ) {
            minPoseGridDepth = extract<dReal>(oparams["minPoseGridDepth"]);
        }
        params.minPoseGridDepth = minPoseGridDepth;

        dReal maxPoseGridDepth = 1.5;
        if( DICT_CONTAINS_KEY(oparams, "maxPoseGridDepth") ) {
            maxPoseGridDepth = extract<dReal>(oparams["maxPoseGridDepth"]);
        }
        params.maxPoseGridDepth = maxPoseGridDepth;

        dReal minPatternTiltAngle = 10 * M_PI / 180;
        if( DICT_CONTAINS_KEY(oparams, "minPatternTiltAngle") ) {
            minPatternTiltAngle = extract<dReal>(oparams["minPatternTiltAngle"]);
        }
        params.minPatternTiltAngle = minPatternTiltAngle;

        dReal maxPatternTiltAngle = 30 * M_PI / 180;
        if( DICT_CONTAINS_KEY(oparams, "maxPatternTiltAngle") ) {
            maxPatternTiltAngle = extract<dReal>(oparams["maxPatternTiltAngle"]);
        }
        params.maxPatternTiltAngle = maxPatternTiltAngle;

        dReal maxSamplingIterationsPerPose = 100;
        if( DICT_CONTAINS_KEY(oparams, "maxSamplingIterationsPerPose") ) {
            maxSamplingIterationsPerPose = extract<dReal>(oparams["maxSamplingIterationsPerPose"]);
        }
        params.maxSamplingIterationsPerPose = maxSamplingIterationsPerPose;

        return params;
    }
